import React from "react";
//import styles from "../styles/cardComponent.module.css";



const DogCard = ({ dog }) => {
  return (
    <div>
      <h2>{dog.name}</h2>
      <img src={dog.image} alt={dog.name} />
      <p>Weight: {dog.weight}</p>
      <p>Temperaments: {dog.temperaments.join(", ")}</p>
    </div>
  );
};

export default DogCard;
